import java.util.*;

public class Main {
    public static void main(String[] args) {
        String s = "";
        String t = "";
        System.out.println("Can we construct ransom note from magazine: "+isAnagram(s, t));
        System.out.println("Can we construct ransom note from magazine: "+isAnagramCheck(s, t));
    }

    //22ms
    private static boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        Map<Character, Integer> sCharacterFrequencyMap = new HashMap<>();
        Map<Character, Integer> tCharacterFrequencyMap = new HashMap<>();
        storeFrequency(s, sCharacterFrequencyMap);
        storeFrequency(t, tCharacterFrequencyMap);
        if (tCharacterFrequencyMap.keySet().size() != sCharacterFrequencyMap.keySet().size()) {
            return false;
        }
        for(char c : tCharacterFrequencyMap.keySet()) {
            if (!sCharacterFrequencyMap.containsKey(c)) {
                return false;
            }
            if (!tCharacterFrequencyMap.get(c).equals(sCharacterFrequencyMap.get(c))) {
                return false;
            }
        }
        return true;
    }

    private static void storeFrequency(String s, Map<Character, Integer> frequencyMap) {
        for (int i = 0; i < s.length(); i++) {
            if (frequencyMap.containsKey(s.charAt(i))) {
                frequencyMap.put(s.charAt(i), frequencyMap.get(s.charAt(i)) + 1);
                continue;
            }
            frequencyMap.put(s.charAt(i), 1);
        }
    }

    //using array to store the frequency.
    //3ms
    private static boolean isAnagramCheck(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        int[] frequencyArray = new int[26];
        for(char c : s.toCharArray()) {
            frequencyArray[c-'a']++;
        }
        for(char c : t.toCharArray()) {
            frequencyArray[c-'a']--;
        }
        for(int i : frequencyArray) {
            if (i != 0) {
                return false;
            }
        }
        return true;
    }
}
